import{_ as r,c as a,o as t,ag as n}from"./chunks/framework.S-Qvb3wi.js";const m=JSON.parse('{"title":"Partner Manager Guide","description":"","frontmatter":{"title":"Partner Manager Guide","lang":"en-GB","lastUpdated":true,"search":false},"headers":[],"relativePath":"guide/partner-manager.md","filePath":"guide/partner-manager.md","lastUpdated":1756530295000}'),o={name:"guide/partner-manager.md"};function s(i,e,l,d,p,h){return t(),a("div",null,e[0]||(e[0]=[n('<h1 id="pm-guide" tabindex="-1">Partner Manager Guide <a class="header-anchor" href="#pm-guide" aria-label="Permalink to &quot;Partner Manager Guide {#pm-guide}&quot;">​</a></h1><h2 id="requirements" tabindex="-1">How do I know if someone meet the <em>partnership requirements</em>? <a class="header-anchor" href="#requirements" aria-label="Permalink to &quot;How do I know if someone meet the *partnership requirements*? {#requirements}&quot;">​</a></h2><h3 id="paid-partnership" tabindex="-1">Paid Partnership <a class="header-anchor" href="#paid-partnership" aria-label="Permalink to &quot;Paid Partnership&quot;">​</a></h3><ul><li>Must follow Discord <a href="https://discord.com/terms" target="_blank" rel="noreferrer">TOS</a> &amp; No NSFW.</li><li>Open a <code>#ticket</code> for more information.</li></ul><h3 id="partnership" tabindex="-1">Partnership <a class="header-anchor" href="#partnership" aria-label="Permalink to &quot;Partnership&quot;">​</a></h3><ul><li>If you do not have <strong>at-least 5,000 members</strong> we will not partner.</li><li>Must follow Discord <a href="https://discord.com/terms" target="_blank" rel="noreferrer">TOS</a> &amp; No NSFW.</li><li>Editing Server (optional)</li><li>Have a good moderation/similar rules.</li><li>Please submit a permanent invite while asking to partner. If the invite is found invalid later on, your ad will be deleted.</li></ul><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>We do not accept partnerships with other leaking servers unless approved by Ledd.</p></div><h2 id="requirements-2" tabindex="-1">What should I do if someone applies but <strong>doesn’t meet</strong> the <em>requirements</em>? <a class="header-anchor" href="#requirements-2" aria-label="Permalink to &quot;What should I do if someone applies but **doesn’t meet** the *requirements*? {#requirements-2}&quot;">​</a></h2><p>Politely let them know they don’t qualify and encourage them to reapply once they meet the criteria.</p><h2 id="acceptance" tabindex="-1">Can I <strong>accept</strong> or <strong>reject</strong> partnerships on my own? <a class="header-anchor" href="#acceptance" aria-label="Permalink to &quot;Can I **accept** or **reject** partnerships on my own? {#acceptance}&quot;">​</a></h2><p>Yes, you can, as long as the server meets our partnership requirements and is safe (no TOS violations, NSFW, or shady activity). We don’t restrict you from partnering elsewhere.</p><h2 id="requests" tabindex="-1">Where do I respond to partnership requests? <a class="header-anchor" href="#requests" aria-label="Permalink to &quot;Where do I respond to partnership requests? {#requests}&quot;">​</a></h2><p>Use the designated ticket channel for partnerships.</p><h2 id="denied" tabindex="-1">What if someone <strong>keeps asking</strong> for partnership even after being denied? <a class="header-anchor" href="#denied" aria-label="Permalink to &quot;What if someone **keeps asking** for partnership even after being denied? {#denied}&quot;">​</a></h2><p>Let a Moderator know. You’re not expected to handle persistent or pushy users alone.</p><h2 id="suggestions" tabindex="-1">Can I <strong>suggest</strong> potential partners to the team? <a class="header-anchor" href="#suggestions" aria-label="Permalink to &quot;Can I **suggest** potential partners to the team? {#suggestions}&quot;">​</a></h2><p>Yes! If you see a server or group that looks like a great fit, bring it up to Ledd or the team.</p><h2 id="difference" tabindex="-1">What’s the difference between a <strong>normal partner</strong> and a <strong>paid partner</strong>? <a class="header-anchor" href="#difference" aria-label="Permalink to &quot;What’s the difference between a **normal partner** and a **paid partner**? {#difference}&quot;">​</a></h2><p>Normal partners must meet all the partnership requirements listed here: <a href="#requirements"><strong>#requirements</strong></a></p><p>Paid partners don’t need to meet those requirements but must still follow our rules — especially no NSFW and must comply with Discord TOS.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>All paid partnership requests must be forwarded to Ledd. Partner Managers are not allowed to process or approve them — only Ledd handles anything involving payments.</p></div>',21)]))}const c=r(o,[["render",s]]);export{m as __pageData,c as default};
